jQuery(document).ready(function($) {
    // Accordion
    var initializeBlock = function( $block ) {
        
        function fullLeft() {
            var itemMargin = jQuery('.left-right-margin').outerWidth(true);
            var itemWidth = jQuery('.left-right-margin').width();

            calcMargin = (itemMargin - itemWidth)/2;


            jQuery(".black-ribbon .img-holder, .image-title-module .img-holder").css('left', -calcMargin + 'px');
            jQuery(".left .svg-img-cover.stretch").css('left', -calcMargin + 'px');
            jQuery(".right .svg-img-cover.stretch").css('right', -calcMargin + 'px');
            
        }

        fullLeft();
        
    };

     // Initialize dynamic block preview (editor).
	if( window.acf ) {
	    window.acf.addAction( 'render_block_preview/type=black-ribbon', initializeBlock );
	}

    console.log("black ribbon module");
});